* ĝenerale loĝantojn de Ĉina Popola Respubliko; 
* la plej nombran kaj verŝajne la plej konatan etnon, vivanta sur teritorio de Ĉinio - hanojn; 
* eventuale ankaŭ pluajn etnojn, vivantaj en Ĉinio, sed kutime ne tibetanojn aŭ ujgurojn. Ĉinoj estas anoj de la ĉina nacio. Tio estas pli vasta kategorio ol la hanoj, kiuj estas la ĉefa etno en Ĉinujo. En la ĉina lingvo mem, oni distingas inter 中华民族 (Zhōnghuá Mínzú, ĉina nacio) kaj 汉族 (hànzú, hanoj). Krom la hanoj, al la ĉina nacio ankaŭ apartenas aliaj etnoj kiel la mongoloj, la tibetanoj, la hujoj kaj la manĉuoj. Nuntempe Ĉinio oficiale agnoskas 56 etnojn kiel apartenantajn al la ĉina nacio. La koncepto de "ĉina nacio" estis kreita fine de la Qing-dinastio (do fine de la 19-a kaj komence de la 20-a jarcento) por pravigi la ekziston de regno kiu regas tiujn diversajn etnojn. Antaŭe la esprimo Zhōnghuá Mínzú nur estis uzata por la hana popolo. Nuntempe multaj ĉinoj akceptas la ekziston de nacia unueco, kvankam daŭre ekzistas kontroversoj pri ĝi: precipe kelkaj tibetanoj kaj kelkaj ujguroj malakceptas tiun koncepton. En Esperanto ekzistas ankaŭ la vorto "ĉinujano" (aŭ "ĉiniano"), kiu povas esti uzata kun ankoraŭ pli ĝenerala signifo ol "ĉino" (do ankaŭ por loĝantoj de Ĉinio, kiuj apartenas al neniu el la 56 ĉinaj etnoj), kaj kiu povas esti uzata, eĉ se oni ne volas aliĝi al la teorio ke ekzistas "ĉina nacio".
